import ReactDOM from "react-dom";

import add from "./App";
import {Sub,div,mult} from "./App";

ReactDOM.render(
 <>
  <ul>
    <li>Sum of two no is {add(40,4)}</li>
    <li>Difference of two no is {Sub(60,7)}</li>
    <li>Division of two no is{div(12,6)}</li>
    <li>Multiplication of two no is{mult(5,2)}</li>
  </ul>
 </>
,document.getElementById("root"));
